using System;
using MineNET.IO;
using MineNET.NBT.IO;
using MineNET.NBT.Tags;

namespace MineNET.Network.MinecraftPackets
{
    public class AvailableEntityIdentifiersPacket : MinecraftPacket
    {
        public override byte PacketID { get; } = MinecraftProtocol.AVAILABLE_ENTITY_IDENTIFIERS_PACKET;

        public byte[] Tag { get; set; } = Convert.FromBase64String(AvailableEntityIdentifiersPacket.HARDCODED_NBT_BLOB);

        protected override void EncodePayload()
        {
            //CompoundTag t = NBTIO.ReadTag(this.Tag, NBT.Data.NBTEndian.BIG_ENDIAN);
            //Logger.Info(t.ToString());
            this.WriteBytes(this.Tag);
        }

        protected override void DecodePayload()
        {
            this.Tag = this.ReadBytes();
        }

        public const string HARDCODED_NBT_BLOB = 
            "";

    }
}
